;; **
;;; some definitions are required to get started
;; **

;; @@
(defn pdiv [x y] (if (zero? y) 1 (/ x y)))

(def functions
  [{:name '+ :arity 2}
   {:name '- :arity 2}
   {:name '* :arity 2}
   ;;{:name 'Math/sin :arity 1}
   {:name 'pdiv :arity 2}])

(defn functionalise [ex] (eval (list 'fn '[x] ex)))

(def terminals
  [(constantly 'x)
   rand])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mellow-briars/terminals</span>","value":"#'mellow-briars/terminals"}
