;; **
;;; This bit deals with genetic operations.
;;; 
;;; First up are some helper functions
;; **

;; @@
(defn expr-zip
  [expr]
  (zip/zipper
    (constantly true)
    (fn [node] (if (seq? node) (rest node) nil))
    (fn [node children] (with-meta (conj children (first node)) (meta node)))
    expr))
(defn tree-replace
  [tree index new-tree]
  (let [subtree-z (nth (iterate zip/next (expr-zip tree)) index)
        new-zipper (zip/replace subtree-z new-tree)]
    (zip/root new-zipper)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mellow-briars/tree-replace</span>","value":"#'mellow-briars/tree-replace"}
;; <=

;; @@
(defn count-nodes
  [ex]
  (if (seq? ex)
  	(+ 1 (apply + (map count-nodes (rest ex))))
    1))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;mellow-briars/count-nodes</span>","value":"#'mellow-briars/count-nodes"}
;; <=

;; **
;;; This is the mutate function itself
;; **

;; @@
(defn o-mutate
  [expr new-tree-func]
  (let [size (count-nodes expr)
        target (rand-int size)]
    (tree-replace expr target (new-tree-func))))

(defn d-mutate
  [expr]
  (o-mutate expr d-random))


